import './App.css';

function Navbar() {
  return (
    <nav>
      <img src="memelogo.png" alt='meme logo' />
      <h2>Meme Generator</h2>
      <h4>Home</h4>
    </nav>
  )
}

function App() {
  return (
    <div>
      <Navbar />
    </div>
  );
}

export default App;
